INSERT INTO `artikel` (`id_artikel`, `gambar_artikel`, `judul`, `deskripsi`, `HARI`, `tanggal_waktu`) VALUES
(1, , 'BNPB Catat Selama 4 Bulan, Indonesia Diterpa 1.586 Bencana', 'Badan Nasional Penanggulangan Bencana (BNPB) mencatat ada 1.586 kejadian bencana di Indonesia selama 1 Januari hingga 30 April 2019. Dari ribuan bencana itu juga memakan korban meninggal dunia dan hilang mencapai 438 orang.\r\n\r\n\"Dampak bencana yang ditimbulkan 325 orang meninggal dunia, 113 orang hilang, 1.439 orang luka-luka dan 996.143 orang mengungsi dan menderita,\" kata Kepala Pusat Data Informasi dan Humas BNPB Sutopo Purwo Nugroho, di Graha BNPB, Jalan Pramuka Raya, Jakarta Timur, Selasa (30/4/2019).\r\n\r\nKerusakan fisik meliputi 3.588 rumah rusak berat, 3.289 rumah rusak sedang, 15.376 rumah rusak ringan, 325 bangunan pendidikan rusak, 235 fasilitas peribadatan rusak dan 78 fasilitas kesehatan rusak.\r\n\r\nDia menambahkan, lebih dari 98 persen bencana yang terjadi adalah bencana hidrometeorologi. Sedangkan 2 persen bencana geologi.\r\n\r\nSelain itu, selama 2019 ini ada tiga kejadian bencana yang menimbulkan korban jiwa dan kerugian yang cukup besar. Yaitu banjir dan longsor di Sulawesi Selatan pada Januari 2019, yang menyebabkan 82 orang meninggal dunia, 3 orang hilang, dan 47 orang luka. Kerugian dan kerusakan ditaksir Rp 926 miliar.\r\n\r\n\"Banjir dan longsor di Sentani Provinsi Papua pada 16 Maret yang menyebabkan 112 orang meninggal dunia, 82 orang hilang, dan 965 orang luka. Kerugian dan kerusakan mencapai Rp 668 miliar. Dan ketiga banjir dan longsor di Bengkulu pada 27 April, menyebabkan 29 orang meninggal dunia, 13 orang hilang dan 4 orang luka. Kerugian dan kerusakan sekitar Rp 200 milyar, itu data sementara,\" jelas dia.\r\n\r\nLebih lanjut Sutopo menjelaskan, kejadian bencana tahun ini mengalami kenaikan 7,2 persen dibanding 2018. Pada 2018 terjadi 1.480 bencana, sedangkan 2019 terjadi 1.586 kejadian.\r\n\r\n\"Untuk korban jiwa, juga terjadi kenaikan 192 persen di mana pada tahun 2018 terdapat 150 orang meninggal dunia dan hilang, sedangkan pada 2019 korban meninggal dan hilang tercatat 438 orang. Begitu pula korban luka-luka juga mengalami kenaikan 212 persen. Korban luka pada tahun 2018 sebanyak 461 orang sedangkan tahun 2019 sebanyak 1.439 orang,\" tambahnya.', 'Rabu', '2019-05-01');
INSERT INTO `artikel` (`id_artikel`, `gambar_artikel`, `judul`, `deskripsi`, `HARI`, `tanggal_waktu`) VALUES
(2, , 'Alih Fungsi Lahan Jadi Penyebab Utama Banjir dan Longsor Bengkulu', 'Badan Nasional Penanggulangan Bencana (BNPB) menyebut alih fungsi lahan jadi penyebab terjadinya banjir dan longsor di Bengkulu. Hutan diubah untuk aktivitas pertambangan dan perkebunan menyebabkan berkurangnya area resapan air.\r\n\r\nKepala BNPB Doni Monardo mengatakan, curah hujan yang tinggi bukan jadi penyebab utama banjir dan tanah longsor di Bengkulu. Kerusakan lingkungan berupa alih fungsi lahan jadi faktor penting terjadinya bencana tersebut.\r\n\r\n\"Di samping karena curah hujan tinggi ada faktor lain. Yaitu luas tutupan lahan yang berkurang,\" kata Doni usai dialog kesiapsiagaan bencana di Malang, Jawa Timur, Senin, 29 April 2019, malam.\r\n\r\nPadahal, hutan jadi salah satu tempat ideal menangkap air. Akar pohon bisa menyerap air sedangkan humus juga mampu menahan air. Banjir di Bengkulu disebabkan alih fungsi lahan, membuat area tangkapan air turut berkurang.\r\n\r\n\"Perubahan fungsi lahan mungkin karena ada sejumlah lahan pertambangan, ada perkebunan. Intinya adalah peralihan fungsi yang tadinya hutan konservsi berubah ke lainnya,\" ucap Doni.\r\n\r\nSelain itu, ada daerah yang mengabaikan peringatan dari pemerintah provinsi. Agar tidak mendirikan permukiman di zona rendah rawan banjir dan longsor. Sehingga, begitu terjadi bencana banjir di Bengkulu mereka terdampak langsung.\r\n\r\n\"Sudah ada peringatan agar tidak lagi menempati menduduki zona rendah, ternyata tidak semua keluar dari zona itu,\" kata Doni.\r\n\r\nDoni Monardo sudah berkunjung ke Bengkulu pada Senin pagi. Data sementara, bencana itu menyebabkan 29 orang meninggal dunia dan 13 orang hilang. Itu belum terhitung korban luka maupun 12 ribu warga yang harus mengungsi ke berbagai tempat.\r\n\r\n\"Untuk data korban itu sampai dengan Senin pukul 11.00 WIB, mungkin bisa berubah lagi. Saya belum cek data terbaru,\" ujar Doni.\r\n\r\nBNPB sudah menyerahkan bantuan sebesar Rp2,25 miliar untuk bencana alam tersebut. Dana itu kemudian diserahkan ke (BPBD) kota/kabupaten sesuai tingkat kerusakan tiap daerah.', 'Rabu', '2019-05-01');
INSERT INTO `artikel` (`id_artikel`, `gambar_artikel`, `judul`, `deskripsi`, `HARI`, `tanggal_waktu`) VALUES
(4, , 'Jateng Barat Dilanda Banjir dan Longsor, Kapan Cuaca Ekstrem Berakhir ?', 'Beberapa hari terakhir, cuaca ekstrem melanda wilayah Jawa Tengah bagian barat selatan mulai dari Banyumas, Cilacap, Purbalingga, Banjarnegara, dan Kebumen.\r\n\r\nAkibatnya, banjir, longsor, dan tiupan angin kencang atau puting beliung pun terjadi wilayah di sisi barat selatan Jawa Tengah ini.\r\n\r\nDi Kebumen misalnya, Badan Penanggulangan Bencana Daerah (BPBD) mencatat, hingga Kamis pagi, 17 Januari 2019, bencana alam terjadi di 75 titik. Bencana yang terjadi berupa banjir, longsor, dan angin kencang.\r\n\r\nDi Kabupaten Banjarnegara, cuaca ekstrem memicu puluhan longsor terjadi sejak awal pekan. Tujuh di antaranya berdampak cukup serius. Hanya dalam sehari, Rabu, 16 Januari 2019, ada empat longsor di kabupaten yang didominasi wilayah pegunungan ini.\r\n\r\nDi Kabupaten Banyumas, banjir dan longsor dilaporkan di 11 desa empat kecamatan. Empat kecamatan tersebut yakni, Sumpiuh, Tambak, Kemranjen, dan Kebasen.\r\n\r\nHari ini, BPBD dan relawan kebencanaan fokus pada upaya perbaikan tanggul jebol dan menyingkirkan material longsoran untuk mengantisipasi dampak lanjutan.\r\n\r\nDi Kecamatan Sumpiuh, Banyumas, warga bersama petugas BPBD dan ratusan relawan hari ini mulai menutup tanggul Sungai Angin yang jebol pada Rabu dan menyebabkan banjir di Kelurahan Sumpiuh dan Prembun Kecamatan Sumpiuh.\r\n\r\nDipicu cuaca ekstrem, ratusan rumah dan ratusan hektare lahan pertanian terendam. Hari ini, banjir mulai surut. Namun, dikhawatirkan curah hujan tinggi menyebabkan debit sungai kembali naik dan memicu banjir susulan.\r\n\r\n\"Hari ini giatnya itu memperbaiki tanggul yang jebol. Kalau sekarang yang sedang dipantau adalah Grumbul Nusapule Desa Nusadadi,\" ucap Komandan Taruna Tanggap Bencana (Tagana) Banyumas, Heriana Ady Chandra, Kamis, 2 Mei 2019.', 'Kamis', '2019-05-02');
INSERT INTO `artikel` (`id_artikel`, `gambar_artikel`, `judul`, `deskripsi`, `HARI`, `tanggal_waktu`) VALUES
(5, , 'Detik-Detik Gedung SMPN 22 Pontianak Ambruk', 'Mata Lina berkcaca-kaca. Sesekali tangannya menunjuk sebuah bangunan. Wanita paruh baya ini merupakan orangtua siswa SMPN 22 Pontianak yang berada di Kalimantan Barat. \r\n\r\nPada Jumat siang, 26 April 2019, pukul 14.10 WIB, bangunan SMPN 22 Pontianak  tiba-tiba ambruk. Lokasinya berada di Komplek Purnama agung V, Jalan Purnama, Kelurahan Parit Tokaya, Kecamatan Pontianak Selatan, Kota Pontianak.\r\n\r\nMendadak sontak Lina cemas pada anak lelakinya yang menuntut ilmu di sekolah itu. Setelah mendapat kabar dari orangtua murid lainnya, ia langsung ke sekolah menjemput anaknya. Beruntung anak Lina selamat. Sebab, pada saat kejadian berada di luar kelas.\r\n\r\n\"Rupanya anak saya sudah pulang duluan. Was-was saya. Maka saya langung ke sekolah. Anak saya kelas 3, udah ujian dia. Nunggu kelulusan saja,\" kata Lina kepada Peduli-Pedia.co.id di lokasi kejadian.\r\n\r\nKecemasan dan kepanikan tidak hanya dirasakan oleh Lina semata. Maurah, siswi kelas X SMAN 10 Pontianak yang gedung sekolahnya berhadapan langsung dengan SMPN 22 Pontianak pun cemas. Perempuan berparas cantik ini menuturkan, ia menyaksikan detik-detik ambruknya bangunan SMPN 22 Pontianak itu di depan sekolahnya.\r\n\r\n\"Rubuhnya pelan-pelan. Ada debu beterbangan. Saya di depan kelas,\" ucapnya yang masih terlihat syok atas kejadian bangunan SMPN 22 Pontianak itu.\r\n\r\nSiswi lainnya, Amelia, kakak kelas Maurah, mengaku sempat mendengar suara gemuruh sebelum gedung SMPN 22 Pontianak tiba-tiba ambruk.\r\n\r\nKepala SMP Negeri 22 Pontianak, Santoso, merasa beruntung lantaran saat kejadian seluruh anak didiknya tidak sedang dalam kegiatan belajar mengajar.\r\n\r\n\"Saya dapat informasi dari guru, dan melihat gedung sekolah ini ambruk. Untungnya kegiatan belajar udah selesai sejak pukul 10.35 wib. Jadi saat kejadian tidak ada lagi kegiatan belajar mengajar berlansung,\"  kata  Santoso.\r\n\r\nGuru SMP Negeri 22 Pontianak, Sugeng Triono, menjelaskan, gedung yang ambruk baru dipakai tahun 2007. Gedung sebelumnya dipakai untuk SMKN 2.', 'Sabtu', '2019-04-27');

